import { Box, Input, TextField, Typography } from "@mui/material";
import React from "react";
import { THEME } from "../constants/Theme";


function StyledTextField({ text, icon, height, width, marginTop, type, padding}) {
  return (
    <Box
      sx={{
        backgroundColor: "#FAFAFA",
        width: width || "none",
        height: height || "45px",
        padding: "0 0px 0 0px" || padding,
        borderRadius: "8px",
        display: "flex",
        alignItems: "center",
        marginTop: marginTop || "none",
      }}
    >
      <Box
        sx={{
          width: "16px",
          height: "16px",
          mr: "14px",
          color: THEME.GREY_PRIMARY,
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        {icon}
      </Box>
      <Input
        placeholder={text}
        sx={{ color: THEME.GREY_PRIMARY, fontSize: "14px", width: "100%" }}
        disableUnderline="true"
        type={type == "password" ? "password" : "email"}
      />
    </Box>
  );
}

export default StyledTextField;
